import React from 'react';
import {add,sub,div,mul} from './Calc';
function App() {
    return (
        <>
            <ul>
                <li> <h3>Sum of two no is {add(40, 4)}</h3> </li>
                <li> <h3>Sub of two no is {sub(40, 4)}</h3>  </li>
                <li> <h3>Div of two no is {div(40, 4)}</h3>  </li>
                <li> <h3>multiply of two no is {mul(40, 4)}</h3>  </li>
            </ul>
        </>);
}
export default App;
